INSERT INTO resources(url,title,description,date) VALUES('https://midu.dev/desactivar-reglas-eslint/','Desactivar reglas de eslint','ESLint es una herramienta de linting de JavaScript que ayuda a encontrar y corregir problemas en el código. A veces, puede que una regla específica no se ajuste a tus necesidades o preferencias, y necesites desactivarla.','2024-01-30');